import React, { Component, createContext } from "react";

export const TeachersContext = createContext();

export class ThemeProvider extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isDarkMode: true
    };
  }

  render() {
    return (
      <TeachersContext.Provider value={{ ...this.state }}>
        {this.props.children}
      </TeachersContext.Provider>
    );
  }
}
